INSERT INTO `messages_lang` VALUES (1,'faq','FAQ: aquí están algunas de las preguntas más frecuentes.',NULL),(2,'faq_q','¿Qué tipo de TFG se puede hacer?',NULL),(3,'faq_q','¿Cuándo hay que seleccionar un TFG?',NULL),(4,'faq_q','¿Dónde está la documentación relacionada con el TFG?',NULL),(5,'faq_q','¿Qué hay que escribir en la memoria del TFG? (ejemplos)',NULL),(6,'faq_q','¿Cuál es la rúbrica de evaluación?',NULL),(7,'faq_r','Un TFG puedes ser propuesto por:\n   -Un profesor\n   -Un alumno\n   -Una empresa\n\nAdemás, los tipos de TFG que se pueden hacer son:\n   -Proyectos clásicos\n   -Memoria de desarrollo de una idea o prototipo\n   -Estudios\n\nMás informacíon en https://www.ehu.eus/documents/6810447/8782654/Normativa_bTFG+BIE_EIB_2017_cast.pdf',NULL),(8,'faq_r','Puedes seleccionar un TFG cuando quieras. Ten en cuenta que si es una propuesta propia o de una empresa, la idea tiene que ser aprobada por x profesores.\nAdemás, 2 veces al año (Octubre y Mayo) los profesores publican en egelapi https://egelapi.ehu.eus/course/view.php?id=408 algunas propuestas.',NULL),(9,'faq_r','La documentación se encuentra en https://www.ehu.eus/es/web/ingeniaritza-bilbo/graduen-araudiak .\n\nEn esta página está la normativa del TFG, las fechas de convocatorias, la portada y otros documentos relacionados con el TFG.',NULL),(10,'faq_r','En https://www.ehu.eus/documents/6810447/8782654/Normativa_bTFG+BIE_EIB_2017_cast.pdf  se explica que partes principales tiene que tener.\nAdemás, es recomendable ver proyectos anteriores que se pueden encontrar en ADDI https://addi.ehu.es/handle/10810/2017/discover?query=%22Grado+en+Ingenier%C3%ADa+Inform%C3%A1tica%22&submit=&rpp=10&sort_by=dc.date.issued_dt&order=desc.',NULL),(11,'faq_r','La rúbrica de evaluación se puede encontrar en https://www.ehu.eus/documents/6810447/8782654/Normativa_bTFG+BIE_EIB_2017_cast.pdf/447e24ec-a7e6-0e10-88ef-a4d15425beb3.',NULL),(12,'faq_q','¿Cuál es el proceso a seguir para defender el TFG?',NULL),(13,'faq_r','Flujograma',NULL),(14,'faq_q','¿Cuándo son las convocatorias?',NULL),(15,'faq_r','Al año hay 4 convocatorias: Noviembre, Febrero-Marzo, Junio-Julio y Julio-Septiembre.\nMás información en https://www.ehu.eus/documents/6810447/8782654/CONVOCATORIAS+TFG+2017-18_DEF_v2_cas.pdf/d958ee63-3759-1129-68bd-2d9603a05687.',NULL),(16,'faq_q','¿Cuándo es la siguiente convocatoria?',NULL),(17,'faq_r','La siguiente convocatoria es el ##',NULL),(18,'notificacion_matricula','La fecha límite para la matrícula es ##',NULL),(19,'notificacion_secretaria','La fecha límite para la entrega en secretaría es ##',NULL),(20,'notificacion_solicitudDefensa','La fecha límite para la solicitud de la defensa es ##',NULL),(21,'notificacion_vistoBueno','La fecha límite para el visto bueno es ##',NULL),(22,'notificacion_defensa','LLa fecha límite para la defensa es ##',NULL),(23,'fws','dsfcx','zcxcz'),(24,'prueba','Esto es una prueba',''),(25,'prueba_respuesta','Esta es la respuesta\r\n1\r\n2\r\n3\r\n',''),(26,'prueba_respuesta2','Y esto sigue\r\n?',''),(27,'yop','nop','baip');
